import React, { Component } from 'react';

class AssidBar extends Component {
  render() {
    return (
      // <nav>
      //   <div className='position-fixed'>
      //     <ul className='d-flex flex-column justify-content-center gap-2' id='assidbar'>
      //       <li><a href='#home' className='nav-link scrollto'><i className='bi bi-house-door h3'></i> <span>Home</span></a></li>
      //       <li><a href='#about' className='nav-link scrollto'><i className='bi bi-person h3'></i> <span>About</span></a></li>
      //       <li><a href='#resume' className='nav-link scrollto'><i className='bi bi-file-earmark h3'></i> <span>Resume</span></a></li>
      //       <li><a href='#project' className='nav-link scrollto'><i className='bi bi-globe h3'></i> <span>Project</span></a></li>
      //       <li><a href='#services' className='nav-link scrollto'><i className='bi bi-hdd-stack h3'></i> <span>Services</span></a></li>
      //       <li><a href='#contact' className='nav-link scrollto'><i className='bi bi-envelope h3'></i> <span>Contact</span></a></li>
      //     </ul>
      //   </div>
      // </nav>

      <header className="d-flex flex-column justify-content-center">
        <nav className="navbar nav-menu">
          <ul className='d-flex flex-column gap-2'>
            <li><a href="#hero" className="nav-link"><i className='bi bi-house-door h3'></i> <span>Home</span></a></li>
            <li><a href="#about" className="nav-link"><i className='bi bi-person h3'></i> <span>About</span></a></li>
            <li><a href="#resume" className="nav-link"><i className='bi bi-file-earmark h3'></i> <span>Resume</span></a></li>
            <li><a href="#portfolio" className="nav-link"><i className='bi bi-globe h3'></i> <span>Project</span></a></li>
            <li><a href="#services" className="nav-link"><i className='bi bi-hdd-stack h3'></i> <span>Services</span></a></li>
            <li><a href="#contact" className="nav-link"><i className='bi bi-envelope h3'></i> <span>Contact</span></a></li>
          </ul>
        </nav>
      </header>
    );
  }
}

export default AssidBar;
